            <div className="col desc">
                <div className="row">
                <div className="col-lg ">
                    <img src={phonee} alt="" width="300" className="image"/>
                </div>
                <div className="col-lg">
                    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Corrupti, magni ipsum doloremque, nam eum possimus optio ratione dicta quisquam iste pariatur nemo. Distinctio fuga voluptatem laudantium, ex odio autem, fugiat molestias obcaecati et nemo non ratione cumque? Tenetur, nobis. Laudantium eveniet iure atque delectus suscipit rem! Ipsam explicabo fugit aliquid earum ullam, esse quisquam eveniet, perferendis molestias excepturi, odit omnis.</p>
                </div>
                </div>
            </div>
        </div>
        </div>
     );
}

export default Description;
